  \ + '/HNP_Data.csv')\n    del df['Unnamed: 60']\n    df.columns = ['country_name',\
  \ 'country_code'] + list(df.columns[2:])\n    ndf = df.merge(df_country, how='inner')\n\
  \n    dims = ('country_name', 'country_code', 'region')\n    vv = [str(i) for i\
  \ in range(1960, 2015)]\n    mdf = pd.melt(ndf, id_vars=dims + ('Indicator Code',),\
  \ value_vars=vv)\n    mdf['year'] = mdf.variable + '-01-01'\n    dims = dims + ('year',)\n\
  \n    pdf = mdf.pivot_table(values='value', columns='Indicator Code', index=dims)\n\
  \    pdf = pdf.reset_index()\n    pdf.to_csv(DIR + '/countries.csv')\n    pdf.to_json(DIR\
